    constructor(alFiles: ALFiles, alWriter: ALWriter) {
        this._alFiles = alFiles;
        this.populateALVariables();
        this._alWriter = alWriter;
    }

    private populateALVariables() {
        this.addVariablePatterns();
        this.addTables();
        this.addCodeunits();
    }

    private addTableToALVars(objectID: number, longName: string, shortName: string, objectName: string) {
        this._alVariables.push(new ALVariable(objectID, longName, shortName, "Record", objectName));
    }
    private addCodeunitToALVars(objectID: number, longName: string, shortName: string, objectName: string) {
        this._alVariables.push(new ALVariable(objectID, longName, shortName, "Codeunit", objectName));
    }

    private addReportToALVars(objectID: number, longName: string, shortName: string, objectName: string) {
        this._alVariables.push(new ALVariable(objectID, longName, shortName, "Report", objectName));
    }

    private addVariablePatterns() : void {
        this._alVariablePatterns.push("Name");
        this._alVariablePatterns.push("Count");
        this._alVariablePatterns.push("LineNo");
        this._alVariablePatterns.push("EntryNo");
        this._alVariablePatterns.push("No");
    }

    public variableNameExists(varName : string) : boolean {
        // Todo: Really implement this? ;-)
        // let variablePattern: String | undefined = this._alVariablePatterns.find(i => varName.toUpperCase().includes(i.toUpperCase()));       
        // if (variablePattern) {
        //     return true;
        // }

        //let alVariable = this._alVariables.find(i => i.longVarName.toUpperCase() === varName.toUpperCase());
        let alVariable = this._alVariables.find(i => varName.toUpperCase().includes(i.longVarName.toUpperCase()));
        if (!alVariable) {
            // this._alVariables.find(i => i.shortVarName.toUpperCase() === varName.toUpperCase());
            this._alVariables.find(i => varName.toUpperCase().includes(i.shortVarName.toUpperCase()));
        }
        if (alVariable) {
            return true;
        }
        else {
            return false;
        }
    }

    public getObjectTypeAndNameFromVarName(varName: string) : string {
      // Todo: Really implement this? ;-)
        // let variablePattern: String | undefined = this._alVariablePatterns.find(i => varName.toUpperCase().endsWith(i.toUpperCase()));    
        // if (variablePattern) {
        //     switch (variablePattern.toUpperCase()) {
        //         case "COUNT":
        //             return "Integer";
        //         case "LINENO":
        //             return "Integer";
        //         case "ENTRYNO":
        //             return "Integer";
        //         case "NO":
        //             return "Code[20]";
        //         case "NAME":
        //             return "Text[50]";
        //     }
        // }

        // let alVariable = this._alVariables.find(i => i.longVarName.toUpperCase() === varName.toUpperCase());
        let alVariable = this._alVariables.find(i => varName.toUpperCase().includes(i.longVarName.toUpperCase()));
        if (!alVariable) {
            // this._alVariables.find(i => i.shortVarName.toUpperCase() === varName.toUpperCase());
            this._alVariables.find(i => varName.toUpperCase().includes(i.shortVarName.toUpperCase()));
        }
        if (alVariable) {
            let objName = alVariable.objectName;
            if (this.containsSpecialChars(objName)) {
                objName = "\"" + objName + "\"";
            }
            return alVariable.objectType + " " + objName;
        }
        else {
            return "";
        }
    }

    public addALVarsFromWorkSpace(): void {
        let wsFiles = this._alFiles.workspaceALFiles;
        if (wsFiles.length > 0) {
            this.wsVarsAdded = true;
        }
        for (let i = 0; i <= wsFiles.length; i++) {
            let longName: string = this.removeSpecialChars(wsFiles[i].objectName);
            switch (wsFiles[i].objectType.toUpperCase()) {
                case "CODEUNIT": {
                    this.addCodeunitToALVars(wsFiles[i].objectNo, longName, longName, wsFiles[i].objectName);
                    console.log(wsFiles[i].objectName);
                }
                case "TABLE": {
                    this.addTableToALVars(wsFiles[i].objectNo, longName, longName, wsFiles[i].objectName);
                    console.log(wsFiles[i].objectName);
                }
                case "REPORT": {
                    this.addReportToALVars(wsFiles[i].objectNo, longName, longName, wsFiles[i].objectName);
                    console.log(wsFiles[i].objectName);
                }
                default:
            }
        }
        
        //
        //
        
    }

